public class Solution7 {

  public static void main(String[] args) {
    String a = getString("", 4640);
    String b = "";


    System.out.println(a.equals(b));

    System.out.println(getString("aaaabbb", 6));
  }

  public static String getString(String in, int k) {
    StringBuilder input = new StringBuilder(in);
    if (k > input.length()) return null;
    char[] charArray = new char[input.length()];
    int index = 0;
    while (index < input.length() && k > 0) {
      if (input.charAt(index) != 'a') {
        charArray[index] = 'a';
        input.setCharAt(index, '~');
        k--;
      }
      index++;
    }
    index = input.length() - 1;
    while (k > 0) {
      if (input.charAt(index) == 'a') {
        charArray[index] = 'b';
        input.setCharAt(index, '~');
        k--;
      }
      index--;
    }

    StringBuilder sb = new StringBuilder();
    for (int i = 0; i < input.length(); i++) {
      if (input.charAt(i) != '~') {
        sb.append(input.charAt(i));
      } else {
        sb.append(charArray[i]);
      }
    }
    return sb.toString();
  }
}
